description:
Loners, Losers and Live Ones brings all of Avril Lavigne's previously uncollected songs together into one massive three-volume set! 

It's all here: released songs that appeared on other people's albums, or as B-sides (Loners), demo songs not considered good enough for release (Losers) and Avril's favorite live covers (Live Ones). 

Includes her latest single &quot;Fly&quot;
